class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        if len(s) == 0:
            return True
        cur = 0
        for tt in t:
            if s[cur] == tt:
                cur += 1
            if cur >= len(s):
                return True
        return False


if __name__ == "__main__":
    sol = Solution()
    s = "leeeeetcode"
    t = ""
    print(sol.isSubsequence(s, t))
